  false,\n\t\"url\": null,\n\t\"notes\": \"Several contaminant surveys have been conducted
  on the refuge from 1985 to 1987 (Fish and Wildlife Service 1986; Fish and Wildlife
  Service unpublished data 1987, and 1988). These surveys found elevated levels of
  organochlorines and mercury in several fish tissue samples. The purpose of this
  survey was (1) to determine the current levels of organochlorines, selenium, and
  mercury in fish tissue, water and sediment; (2) to identify significant data gaps
  and recommend studies to fill those data gaps; and (3) to recommend clean-up measures,
  if appropriate.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
